import { Box, Flex, VStack } from '@chakra-ui/react';
import { BsPersonFill } from 'react-icons/bs';
import React from 'react';

const Workouts = () => {
	return (
		<VStack>
			<Box bg="gray">
				<BsPersonFill size="40" />
			</Box>
		</VStack>
	);
};

export default Workouts;
